import mc from "./app.module.scss";

const App = () => {
  useEffect(() => {
    dispatch(checkToken);
    dispatch({ type: "OPEN_CINEMA_SLIDERS" });
    getScreenSize();
  }, []);

  return (
    <div className={mc.container}>
      <span>test</span>
      <canvas></canvas>
    </div>
  );
};

export default App;
